import { createUseStyles } from "react-jss";

const PokemonDetail = () => {
    const classes = useStyles();

    return <tr className={classes.pokemon}><td>{pkmn.name}</td><td>{pkmn.number}</td><td>{pkmn.types.join()}</td><td><img src={pkmn.image}/></td></tr>
}

const useStyles = createUseStyles(
    {
      pokemon: {
        cursor: 'pointer',
      }
    },
    { name: 'PokemonDetail' }
  );

export default PokemonDetail;
